import React from "react";

// Functional Component
const ErrorPage = () => {
    return(
        <div className="error-page">
            <img src="https://toppng.com/uploads/preview/outstanding-accident-free-cars-inspiration-car-accident-vector-11563003013n3cdscvnta.png"></img>
        <p className="error-text">Sorry, we are experiencing technical difficulties. Please try again later or contact us for assistance.</p>
        </div>
        )
        };

// Export
export default ErrorPage;

